import React from 'react';
import styles from '../style/card.module.scss';

const CardMovie = () => {
    return (
        <div className={styles.card__movie}>
            <div className={styles.card__image}></div>
            <div className={styles.card__comment}></div>
        </div>
    )
}

export default CardMovie
